<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <meta content="IE=edge,chrome=1" http-equiv="X-UA-Compatible" />
    <meta
      name="viewport"
      content="width=device-width, initial-scale=1, maximum-scale=1" />

      404 Page not found
    </title>
    





  
  

<link

  rel="stylesheet"
  media="screen"
  integrity="sha256-1AxdszRWKYSUUPOjzObAnl4ImT0L/PyRc3gOY9aUJVQ=" />
<link
  href="./styles/print.min.f6915ad2d683ad008234c9d36acba438806dbe2e53e128c41a2554d57f251bdd.css"
  rel="stylesheet"
  media="print"
  integrity="sha256-9pFa0taDrQCCNMnTasukOIBtvi5T4SjEGiVU1X8lG90=" />

    




  

<script
  src="./js/index.9efde7ff39a11b8d4a8c2f5486ed25466c01c29c040c7d142249710a9b888c28.js"
  integrity="sha256-nv3n/zmhG41KjC9Uhu0lRmwBwpwEDH0UIklxCpuIjCg="
  defer></script>

    
    <style>
      [x-cloak] {
        display: none !important;
      }
    </style>
  </head>
  <body class="index" x-data="{ navOpen: false }" x-cloak>
    <a
      href="#"
      id="nav-button"
      @click="navOpen = !navOpen"
      :class="{'open': navOpen }">
      <span>
        NAV
        <img src="./images/navbar.png" />
      </span>
    </a>
    <div class="toc-wrapper" :class="{'open': navOpen }">
      
      <img src="./images/logo.png" class="logo" />

      
        <div class="search" x-data="searchController">
          <input
            x-model.debounce.100ms="query"
            type="search"
            class="search"
            id="input-search"
            placeholder="Search" />
          <ul
            class="search-results visible"
            x-show="results.length > 0"
            x-transition.duration.700ms>
            <template x-for="item in results">
              <li>
                <a x-text="item.title"></a>
              </li>
            </template>
          </ul>
        </div>
      
      
      
      
        <ul class="toc-footer">
          
            <li>
              <a href='#'>Sign Up for a Developer Key</a>
            </li>
          
            <li>
              Documentation Powered by <a href="https://github.com/bep/docuapi">DocuAPI</a>
            </li>
          
            <li>
              Hugo Theme by <a href="https://github.com/bep">bep</a>
            </li>
          
        </ul>
      
      
    </div>
    <div class="page-wrapper">
      <div class="dark-box"></div>
      <div class="content">
        
  <h2>Page Not Found!</h2>

      </div>
      <div class="dark-box">
        
          <div
            class="lang-selector"
            x-data="langController"
            x-init="initLangs([{&#34;key&#34;:&#34;go&#34;,&#34;name&#34;:&#34;Go&#34;},{&#34;key&#34;:&#34;shell&#34;,&#34;name&#34;:&#34;Shell&#34;},{&#34;key&#34;:&#34;ruby&#34;,&#34;name&#34;:&#34;Ruby&#34;},{&#34;key&#34;:&#34;python&#34;,&#34;name&#34;:&#34;Python&#34;},{&#34;key&#34;:&#34;javascript&#34;,&#34;name&#34;:&#34;Javascript&#34;}])">
            <template x-for="(tab, index) in tabs">
              <a
                x-text="tab.name"
                :class="{ 'active': tab.active }"
                @click="changeLanguage(index)"></a>
            </template>
          </div>
        
      </div>
    </div>
    
  </body>
</html>
